import React from 'react';

interface DetailsProps {
  itemType: 'club' | 'course';
  itemId: number;
  onBack: () => void;
}

export default function Details({ itemType, itemId, onBack }: DetailsProps) {
  return (
    <div>
      <h2>Details for {itemType}</h2>
      <p>ID: {itemId}</p>
      <button onClick={onBack}>Back</button>
    </div>
  );
}
